import React from 'react'
import useSound from 'use-sound'
// import heartSound from '../sounds/heartbeat.mp3'

function HeartIcon() {

  const [play] = useSound(
    '../sounds/heartbeat.mp3',
    { volume: 0.5 }
  )

  return (
    <i id="ChanceLogo" className="icon" onMouseOver={play()} />
  );
}
